import React from 'react';

class MovieCards extends React.Component {
  render() {
    const { movie } = this.props;
    const { title, subtitle, storyline, rating, imagePath } = movie;
    return (
      <section>
        <h2>{ title }</h2>
      </section>
    );
  }
}

export default MovieCards;
